import React, { Component } from 'react';
import { Navbar, Nav, NavItem } from 'react-bootstrap';
import { Link } from "react-router-dom";
import './Navbar.css';


class NavBar extends Component {
  render () {
    return (
      <Navbar style={this.props.style} className="Navbar" collapseOnSelect>
          <Navbar.Header>
            <Navbar.Brand>
                <a href="/">nancy yao</a>
            </Navbar.Brand>
          </Navbar.Header>

          <Navbar.Collapse>
            <Nav pullRight>
              <NavItem>
                <p>code</p>
              </NavItem>
              <NavItem>
                <p>design</p>
              </NavItem>
              <NavItem>
                <p>sketches</p>
              </NavItem>
              <NavItem>
                <p>contact</p>
              </NavItem>
            </Nav>
          </Navbar.Collapse>
      </Navbar>
    );
  }
}

export default NavBar
